import React from 'react';

const MainContent = () => {

    return(
        <div className="col-8">
            <BrowserRouter>
            <Route exact path="/" component={()=> <h1>hello</h1>}/>
            <Route exact path="/g" component={()=> <h1>good</h1>}/>
            </BrowserRouter>
        </div>
    );
}

export default MainContent;
